library orm_domain;@MirrorsUsed(symbols: 'Employee,ImmutableEntity,Job,MutableEntity,Person,User', override: '*')import 'dart:mirrors';import 'package:dorm/dorm.dart';import 'package:observe/observe.dart';part 'employee.dart';part 'immutable_entity.dart';part 'job.dart';part 'mutable_entity.dart';part 'person.dart';part 'user.dart';void ormInitialize() {	EntityAssembler assembler = new EntityAssembler();	assembler.scan(Employee);	assembler.scan(ImmutableEntity);	assembler.scan(Job);	assembler.scan(MutableEntity);	assembler.scan(Person);	assembler.scan(User);}